function populationFitness = calculateFitness_FUN_offspring(population)
  populationSize = size(population,1);
    dimension = size(population,2);
    populationFitness = zeros(1,populationSize);

    i = 1;
    
    while i <= populationSize
      tmp=calculateFitness_FUN(population(i,1),population(i,2),population(i,3),population(i,4),population(i,5), false);
      populationFitness(i)=tmp(1);
      i = i + 1;
        
    end

end

%calculateFitness_FUN(30,  pi/3, 0.1,  0.5,  0.6)
function res = calculateFitness_FUN(alpha__s, omega__s, omega__1, omega__5, omega__6, verbose)

    
        global fun_total safety
        if(verbose)disp('start');end
        step_size = 0.5e0;
        tot_seconds = 180;
        i = 1;
        ax = 1;
        alpha__1 = -1;       %sec_vel_x_h
        alpha__2 = -1.2;     %sec_vel_x_l
        alpha__3 = -0.9;     %sec_vel_z_h
        alpha__4 = -1;       %sec_vel_z_l
        alpha__5 = -0.4;     %sec_acc_norm_h
        alpha__6 = +1000;     %sec_not_safety
        alpha__7 = 1/10e6;%1/10e8;   %total_jerk
        
        fun_total = 0;
        safety = 0;
        total_jerk = 0;
        sec_vel_x_h = 0;
        sec_vel_x_l = 0;
        sec_vel_z_h = 0;
        sec_vel_z_l = 0;
        sec_acc_norm_h = 0;
        sec_not_safety = 0;

        if(verbose)disp('Acceleration');end
        acc_points = zeros(3, (tot_seconds-1)/step_size);
        vel_points = zeros(3, (tot_seconds-1)/step_size);
        for i=1:(tot_seconds*1/step_size)
            tmp=acc_seat_eval(i/(1/step_size),alpha__s, omega__s, omega__1, omega__5, omega__6 );
            acc_points(1,i)=tmp(1);
            acc_points(2,i)=tmp(2);
            acc_points(3,i)=tmp(3);
            tmp=vel_seat_eval(i/(1/step_size),alpha__s, omega__s, omega__1, omega__5, omega__6 );
            vel_points(1,i)=tmp(1);
            vel_points(2,i)=tmp(2);
            vel_points(3,i)=tmp(3);
           % acc_points = [seq((subs(t == x, acc_seat(1))), x == (1..tot_seconds), step_size); seq((subs(t == x, acc_seat(2))), x == (1..tot_seconds), step_size); seq((subs(t == x, acc_seat(3))), x == (1..tot_seconds), step_size);];
        end
        for i = 1:numel(acc_points(1,:))
          if (sqrt(acc_points(1,i)^2+acc_points(2,i)^2+acc_points(3,i)^2)/100>2*9.8)
            sec_acc_norm_h = sec_acc_norm_h + 1;
          end
        end
        
        for ax = 1:3
          %vel_points(ax,= [seq((subs(t == x, vel_seat(ax))), x == (1..tot_seconds), step_size)];
          
          t = [step_size:step_size:tot_seconds];
          % calculate the polynominal 
        pp = interp1(t,acc_points(ax,:),'spline','pp');
        % take the first order derivative of it---> needs curve fitting toolbox
        pp_der=fnder(pp,1);
        % evaluate the derivative at points t (or any other points you wish)
        %slopes=ppval(pp_der,t);
          

          %tmp = CurveFitting:-Spline(<,>([seq(i, i == (1..tot_seconds), step_size)]), <,>(acc_points(ax)), Timer);
          %d2St_spline = unapply(tmp, [Timer]);
          %jerk_f = derive_spline(d2St_spline(Timer), Timer, 1);
          %jerk_points = [seq((jerk_f(Timer)), Timer == (1..tot_seconds), step_size)];
          for i = 1:(tot_seconds-1)/step_size
            total_jerk = total_jerk+ppval(pp_der,i);
          end

          sec_acc_over_h = 0;
          sec_acc_over_l = 0;
          min_a = 0;
          max_a = 0;
          max_exposure_time = 1.5*(1/step_size);
          if (ax == 1)
            min_a = -0.15e1;
            max_a = 5;
          elseif (ax == 2)
            min_a = -0.25e1;
            max_a = 0.25e1;
          elseif (ax == 3)
            min_a = -0.15e1;
            max_a = 5;
          end
          for i = 1:numel(acc_points(ax,:))
            if (acc_points(ax,i)/100>max_a*9.8)
              sec_acc_over_h = sec_acc_over_h + 1;
            elseif (acc_points(ax,i)/100<max_a*9.8 && -1 < sec_acc_over_h)
              if (max_exposure_time < sec_acc_over_h)
                sec_not_safety = sec_not_safety+sec_acc_over_h-max_exposure_time;
              end
              sec_acc_over_h = 0;
            end
            if (acc_points(ax,i)/100<min_a*9.8 )
              sec_acc_over_l = sec_acc_over_l+1;
            elseif (acc_points(ax,i)/100>min_a*9.8  && -1 < sec_acc_over_l)
              if (max_exposure_time < sec_acc_over_l)
                sec_not_safety = sec_not_safety+sec_acc_over_l-max_exposure_time;
              end
              sec_acc_over_l = 0;
            end
          end


          if (ax == 1)
            for i = 1:numel(vel_points(ax,:))
                if (vel_points(ax,i)/100>11.11 )
                    sec_vel_x_h = sec_vel_x_h + 1;
                end
                if (vel_points(ax,i)/100<-11.11)
                    sec_vel_x_l = sec_vel_x_l + 1;
                end
            end
          end
          if (ax == 3)
            for i = 1:numel(vel_points(ax,:))
              if (vel_points(ax,i)/100>11.11 )
                sec_vel_z_h = sec_vel_z_h + 1;
              end
              if (vel_points(ax,i)/100<-11.11)
                sec_vel_z_l = sec_vel_z_l + 1;
              end
            end
          end
        end
    %     disp(sprintf('
    %    sec_vel_x_h: %2f',MBSymba_r6_foundations:-*(sec_vel_x_h, 0.1e1 / MBSymba_r6_foundations:-*(1, 0.1e1 / step_size))));
    %     disp(sprintf('
    %    sec_vel_x_l: %2f',MBSymba_r6_foundations:-*(sec_vel_x_l, 0.1e1 / MBSymba_r6_foundations:-*(1, 0.1e1 / step_size))));
    %     disp(sprintf('
    %    sec_vel_z_h: %2f',MBSymba_r6_foundations:-*(sec_vel_z_h, 0.1e1 / MBSymba_r6_foundations:-*(1, 0.1e1 / step_size))));
    %     disp(sprintf('
    %    sec_vel_z_h: %2f',MBSymba_r6_foundations:-*(sec_vel_z_h, 0.1e1 / MBSymba_r6_foundations:-*(1, 0.1e1 / step_size))));
    %     disp(sprintf('
    %    sec_acc_norm_h: %2f',MBSymba_r6_foundations:-*(sec_acc_norm_h, 0.1e1 / MBSymba_r6_foundations:-*(1, 0.1e1 / step_size))));
    %     disp(sprintf('
    %    sec_not_safety: %2f',MBSymba_r6_foundations:-*(sec_not_safety, 0.1e1 / MBSymba_r6_foundations:-*(1, 0.1e1 / step_size))));
        fun_total = alpha__1*sec_vel_x_h+alpha__2*sec_vel_x_l+alpha__3*sec_vel_z_h+alpha__4*sec_vel_z_l+alpha__5*sec_acc_norm_h+alpha__6*sec_not_safety+alpha__7*total_jerk;
        %fun_evaluationreturn = [fun_total safety];
       
       if(verbose)disp(['sec_vel_x_h:  ', num2str(sec_vel_x_h/(1/step_size)),'  sec_vel_x_l:  ', num2str(sec_vel_x_l/(1/step_size)),'  sec_vel_z_h:  ', num2str(sec_vel_z_h/(1/step_size)),'  sec_vel_z_l:  ', num2str(sec_vel_z_l/(1/step_size)),'  sec_acc_norm_h:  ', num2str(sec_acc_norm_h/(1/step_size)),'  sec_not_safety:  ', num2str(sec_not_safety/(1/step_size))]);end
        res=fun_total;

end


